             // value= {this.props.data.empDate.eCode}
             />
              <Input
              title={'Email'}
            //   value= {this.props.data.empDate.email}
              />
              <Input
              title={'Mã thẻ từ cũ'}
              //value= {this.props.data.empDate.rCode}
              />
              <Input
              title ={'Mã thẻ từ mới'}
              />

              <Button onClick={this.onCancelClick}
                title={'Huỷ'}/>
          </Fragment>
        )
    }
}
